  width: 100%;
  height: 100%;
  margin: 0;
  font-family: verdana;
  box-sizing: border-box;
  padding-bottom: 25px;
}
.pdb-root svg {
  display: block;
}
.pdb-renderer .pdb-root {
  padding-bottom: 0;
}
.pdb-title {
  text-align: center;
}

.pdb-legend {
  text-align: center;
}
.pdb-legend .entry {
  display: inline-block;
  padding: 5px 15px 5px 5px;
  margin-right: 5px;
  cursor: pointer;
}
.pdb-legend .entry:hover {
  background: rgba(255,255,255,0.5);
  transform: scale(1.2);
}
.pdb-legend .entry .mark {
  display: inline-block;
  width: 14px;
  height: 14px;
  border-radius: 50%;
  vertical-align: middle;
  margin-right: 5px;
}
.pdb-legend .entry .name {
  display: inline-block;
  vertical-align: middle;
}
.pdb-popup {
  position: absolute;
  background: rgba(0,0,0,1.0);
  color: #fff;
  padding: 5px 10px;
  border-radius: 5px;
  display: none;
}
.pdb-popup .title, .popup .desc {
  margin-left: 23px;
}
.pdb-popup .mark {
  width: 14px;
  height: 14px;
  border-radius: 50%;
  background: #fff;
  position: absolute;
  left: 10px;
  top: 5px;
}
.pdb-popup:after {
  content: " ";
  display: block;
  width: 10px;
  height: 10px;
  background: #ff0;
  position: absolute;
  transform: rotate(45deg);
  background: rgba(0,0,0,1.0);
  top: 50%;
  margin-top: -5px;
}
.pdb-popup.left:after {
  right: -5px;
}
.pdb-popup.right:after {
  left: -5px;
}

.pdb-popup.float {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  width: 120px;
  height: 45px;
  margin-left: -60px;
  margin-top: 30px;
  padding: 10px 5px;
  display: none;
  text-align: center;
  color: #000;
  font-size: 0.8em;
}
.pdb-popup.float:after {
  display: none;
}
.pdb-popup.float .title {
  height: 20px;
  font-size: 1.2em;
  font-weight: bold;
  margin: 0;
}
.pdb-popup.float .desc {
  font-weight: bold;
  font-size: 0.8em;
  margin: 0;
  margin-bottom: 5px;
}
.pdb-popup.float .value {
  font-size: 0.9em;
}

.hover-box,.hover-margin { position:absolute;z-index:99999;pointer-events:none }
.hover-box { border:1px dashed red }
.hover-margin { border:1px dashed rgba(255,192,0,0.5) }

.axis .domain, .axis .tick line {
  fill: none;
  stroke: #000;
}

#plotdb-mark {
  position: fixed;
  z-index: 999999;
  bottom: 5px;
  right: 5px;
  text-align: center;
  font-size: 12px;
  font-family: optima;
  cursor: pointer;
  color: #000;
  text-decoration: none;
  padding: 5px;
  border-radius: 3px;
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  width: auto;
  height: 16px;
  box-sizing: border-box;
  padding-right: 20px;
  font-size: 12px;
  line-height: 8px;
  color: #999;
  font-family: arial;
}
